God where was my teacher's head when she scheduled me in for my oral exams in German language.. We're now halfway our test week and I've had 5 tests so far, 4 to go this week and 3 next week. The only test I had today was German language, at 11 am. The bitch scheduled me for 2 pm for the oral exams!! Bloody hell.. Still an hour of doing bloody nothing here. 

I had my first grade back today.. 6.6/10 for Dutch language! Also my literature essays have been approved. I screwed up maths pretty badly.. I expect a 1,5/10 at most. I'm not sure on my economics, but since my teacher hates my guts I don't expect that to be any good as well. Same goes for the economics essay.&nbsp; 

Yesterday I took some pics of my spiders outside, they will be in a book about tarantulas that is being written at the moment! I want to put them up here but can anybody tell me where the bloody hell the "add-picture"-button went??
